import React from 'react';
import '../styles/components/layout.css';
import '../styles/pages/search-school-career.css';

const SearchSchoolCareerPage = () => {
    return (
        <div className="search-school-career-page">

            <div className="search-bar">
                <input type="text" placeholder="Tìm kiếm trường hoặc ngành..." />
                <button>Tìm kiếm</button>
            </div>

            <main className="content">
                <section className="results">
                    <h2>Kết quả tìm kiếm</h2>
                    <div className="result-item">Trường 1 - Ngành A</div>
                    <div className="result-item">Trường 2 - Ngành B</div>
                    <div className="result-item">Trường 3 - Ngành C</div>
                </section>
            </main>

        </div>
    );
};

export default SearchSchoolCareerPage;
